INFO - 2022-02-25 01:20:40 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"category_id":24,"previous_section":5,"current_section":6,"next_section":6,"questions":{"id":19,"question_category_id":24,"title_question":"LM01 F","is_publish":1,"section_id":6,"description":"<p><strong>SECTION 3<\/strong><br><strong>READING COMPREHENSION<\/strong><\/p><p>This section is designed to measure your ability to read and understand short passages similar in topic and style to those that students are likely to encounter in North American universities and colleges.<\/p><p><strong>Directions:<\/strong> In this section, you will read several passages. Each one is followed by a number of questions about it. You are to choose the one best answer, (A), (B), (C), or (D), to each question. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Answer all questions about the information in a passage on the basis of what is stated or implied in that passage.<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23T22:25:57.000000Z","updated_at":"2022-02-24T00:50:43.000000Z"},"last_session":{"id":29,"register_number":"2202251645745185","token":"2046110319621813d0d0340","session_key":"d23yuf","start_at":"2022-02-25 08:41:54","finish_at":null,"created_at":"2022-02-24T23:25:04.000000Z","updated_at":"2022-02-24T23:41:54.000000Z"},"first_group":{"id":56,"list_question_id":19,"name":"R1A","description":"Question 1-9","filename_group":"","question_group":"<p>John James Audubon, nineteenth-century artist and naturalist, is known as one of the <strong>foremost<\/strong><i><strong> <\/strong><\/i><strong>(A1) <\/strong>authorities on North American birds. Born in Les Cayes, Haiti, in 1785, Audubon was raised in France and studied art under French artist Jacques-Louis David. After settling on his father's Pennsylvania estate at the age of eighteen, he first began to study and paint birds.<\/p><p><br>In his young adulthood, Audubon undertook numerous enterprises, generally without a tremendous amount of success; at various times during his life he was involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:40:30.000000Z"}}}
