INFO - 2022-02-25 01:22:29 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":56,"current_group":56,"next_group":57,"data_group":{"id":56,"list_question_id":19,"name":"R1A","description":"Question 1-9","filename_group":"","question_group":"<p>John James Audubon, nineteenth-century artist and naturalist, is known as one of the <strong>foremost<\/strong><i><strong> <\/strong><\/i><strong>(A1) <\/strong>authorities on North American birds. Born in Les Cayes, Haiti, in 1785, Audubon was raised in France and studied art under French artist Jacques-Louis David. After settling on his father's Pennsylvania estate at the age of eighteen, he first began to study and paint birds.<\/p><p><br>In his young adulthood, Audubon undertook numerous enterprises, generally without a tremendous amount of success; at various times during his life he was involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:40:30.000000Z"},"exam_questions":[{"id":169,"group_question_id":56,"list_question_id":19,"question":"This passage is mainly about","option_1":"North American birds","option_2":"Audubon's route to success as a painter of birds","option_3":"the works that Audubon published","option_4":"Audubon's preference for travel in natural habitats","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":170,"group_question_id":56,"list_question_id":19,"question":"<p>The word \"foremost\" <strong>(A1)<\/strong> is closest in meaning to<\/p>","option_1":"prior","option_2":"leading","option_3":"first","option_4":"largest","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:34:12.000000Z","exam_result":[]},{"id":171,"group_question_id":56,"list_question_id":19,"question":"In the second paragraph, the author mainly discusses","option_1":"how Audubon developed his painting style","option_2":"Audubon's involvement in a mercantile business","option_3":"where Audubon went on his excursions","option_4":"Audubon's unsuccessful business practices","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]}]}}
