","updated_at":"2022-02-23T02:49:53.000000Z"},{"id":162,"group_question_id":55,"list_question_id":18,"question":"The lobster, <b>like<\/b> <b>many<\/b> crustaceans, can cast off a <b>damaging<\/b> appendage and regenerate a new appendage to nearly <b>normal<\/b> size.","option_1":"like ","option_2":"many","option_3":"damaging ","option_4":"normal","option_5":"","created_at":"2022-02-23T02:49:53.000000Z","updated_at":"2022-02-23T02:49:53.000000Z"},{"id":163,"group_question_id":55,"list_question_id":18,"question":"Humans <b>develop normally<\/b> twenty <b>primary<\/b>, <b>or<\/b> deciduous, teeth and thirty-two <b>permanent<\/b> ones.","option_1":"develop normally ","option_2":"primary","option_3":"or ","option_4":"permanent","option_5":"","created_at":"2022-02-23T02:49:53.000000Z","updated_at":"2022-02-23T02:49:53.000000Z"},{"id":164,"group_question_id":55,"list_question_id":18,"question":"<b>The<\/b> curricula of American public schools <b>are<\/b> set in individual states; they <b>do not determine<\/b> by the <b>federal<\/b> Government.","option_1":"The ","option_2":"are ","option_3":"do not determine ","option_4":"federal","option_5":"","created_at":"2022-02-23T02:49:53.000000Z","updated_at":"2022-02-23T02:49:53.000000Z"},{"id":165,"group_question_id":55,"list_question_id":18,"question":"<p>The fact that the sophisticated technology <strong>has become<\/strong> part of <strong>revolution<\/strong> in travel <strong>delivery<\/strong> systems has not made travel schedules <strong>less<\/strong> hectic.<\/p>","option_1":"has become ","option_2":"revolution ","option_3":"delivery ","option_4":"less","option_5":"","created_at":"2022-02-23T02:49:53.000000Z","updated_at":"2022-02-23T11:50:30.000000Z"},{"id":166,"group_question_id":55,"list_question_id":18,"question":"Balanchine's <b>plotless<\/b> ballets, <b>such<\/b> Jewels and The Four Temperaments, <b>present<\/b> dance <b>purely<\/b> as a celebration of the movement of the human body.","option_1":"plotless ","option