itself (E5) <\/strong>under a layer of warm and moist air, creating a line of thunderstorms that races forward at speeds of approximately forty miles per hour. A squall line, which can be hundreds of miles long and can contain fifty distinct thunderheads, is a magnificent force of nature with incredible potential for destruction. Within the squall line, often near its southern end, can be found supercells, long-lived rotating storms of exceptional strength that serve as the source of tornadoes.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:11:52.000000Z","sequence_exam":[{"id_exam":215,"sequence":47},{"id_exam":216,"sequence":48},{"id_exam":217,"sequence":49},{"id_exam":218,"sequence":50}],"question":[{"id":215,"group_question_id":71,"list_question_id":19,"question":"<p>The pronoun \"itself' <strong>(E5)<\/strong>1 refers to<\/p>","option_1":"a large-scale collision","option_2":"a squall line","option_3":"an advancing cold front","option_4":"a layer of warm and moist air","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:14:40.000000Z"},{"id":216,"group_question_id":71,"list_question_id":19,"question":"All of the following are mentioned in the passage about supercells EXCEPT that they","option_1":"are of short duration","option_2":"have circling winds","option_3":"have extraordinary power","option_4":"can give birth to tornadoes","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":217,"group_question_id":71,"list_question_id":19,"question":"This reading would most probably be assigned in which of the following courses?","option_1":"Geology","option_2":"Meteorology","option_3":"Marine Biology","option_4":"Chemistry","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":218,"group_question_id":71,"list_question_id":19,"question":"The paragraph following the passage most likely discusses"