 involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:40:48.000000Z","sequence_exam":[{"id_exam":172,"sequence":4},{"id_exam":173,"sequence":5},{"id_exam":174,"sequence":6}],"question":[{"id":172,"group_question_id":57,"list_question_id":19,"question":"<p>The word \"mode\" <strong>(A2)<\/strong> could best be replaced by<\/p>","option_1":"method","option_2":"vogue","option_3":"average","option_4":"trend","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:36:47.000000Z"},{"id":173,"group_question_id":57,"list_question_id":19,"question":"Audubon decided not to continue to pursue business when","option_1":"he was injured in an accident at a grist mill","option_2":"he decided to study art in France","option_3":"he was put in prison because he owed money","option_4":"he made enough money from his paintings","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":174,"group_question_id":57,"list_question_id":19,"question":"<p>The word \"pursue\" <strong>(A3)<\/strong> is closest in meaning to<\/p>","option_1":"imagine","option_2":"share","option_3":"follow","option_4":"deny","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:37:18.000000Z"}]},{"id":58,"list_question_id":19,"name":"R1C","description":"Question 1-9","filename_group":"","question_group":"<p>John James Audubon, nineteenth-century artist and naturalist, is known as one of the <strong>foremost<\/strong><i><strong> <\/strong><\/i><strong>(A1) <\/strong>authorities on North American birds. Born in Les Cayes, Haiti, in 1785, Audubon was raised in France and studied art under French artist Jacques-Louis David. After settling on his father's Pennsylvania estate at the age of eighteen, he first began to study and paint birds.<\/p><p><br>In his young adulthood, Audubon undertook numerous enterprises, generally without a tremendous amount of success; at various times during his life he was involved in a mercantile business, a lumber and grist mill, a taxidermy business, and a school. His general <strong>mode (A2) <\/strong>of operating a business was to leave it either unattended or in the hands of a partner and take off on excursions through the wilds to paint the natural life that he saw. His business career came to an end in 1819 when he was jailed for debt and forced to file for bankruptcy.<\/p><p><br>It was at that time that Audubon began to seriously <strong>pursue (A3) <\/strong>the dream of publishing a collection of his paintings of birds. For the next six years he painted birds in their natural habitats while his wife worked as a teacher to <strong>support (A4) <\/strong>the family. His Birds of America, which included engravings of 435 of his colorful and lifelike watercolors, was published in parts during the period from 1826 to 1838 in England. After the success of the English editions, American editions of his work were published in 1839, and his fame and fortune were ensured.<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:41:22.000000Z","sequence_exam":[{"id_exam":175,"sequence":7},{"id_exam":176,"sequence":8},{"id_exam":177,"sequence":9}],"question":[{"id":175,"group_question_id":58,"list_question_id":19,"question":"According to the passage, Audubon's paintings.","option_1":"were realistic portrayals","option_2":"used only black, white. and gray","option_3":"were done in oils","option_4":"depicted birds in cages","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":176,"group_question_id":58,"list_question_id":19,"question":"<p>The word \"support\" <strong>(A4)<\/strong> could best be replaced by<\/p>","option_1":"tolerate","option_2":"provide for","option_3":"side with","option_4":"fight for","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T22:38:30.000000Z"},{"id":177,"group_question_id":58,"list_question_id":19,"question":"It can be inferred from the passage that after 1839 Audubon","option_1":"unsuccessfully tried to develop new businesses","option_2":"continued to be supported by his wife","option_3":"traveled to Europe","option_4":"became wealthy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":59,"list_question_id":19,"name":"R2A","description":"Question 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:10:24.000000Z","sequence_exam":[{"id_exam":178,"sequence":10},{"id_exam":179,"sequence":11},{"id_exam":180,"sequence":12}],"question":[{"id":178,"group_question_id":59,"list_question_id":19,"question":"The subject of the preceding paragraph was most likely","option_1":"ways of producing honey","option_2":"stories in the media about killer bees","option_3":"the chemical nature of killer bee attacks","option_4":"the creation of the killer bee","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated