rong>of the city with his clients' funds protected. In the aftermath of the disaster, Giannini's bank was the first to resume operations. Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p>In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City. In 1930 he <strong>consolidated (D3) <\/strong>all the branches of the Bank of Italy, the Bank of America in New York City, and another Bank of America that he had formed in California into the Bank of America National Trust and Savings Association.<\/p><p>A second major crisis for the bank occurred during the Great Depression of the 1930s. Although Giannini had already retired prior to the darkest days of the Depression, he became incensed when his successor began selling off banks during the bad economic times. Giannini resumed leadership of the bank at the age of sixty-two. Under Giannini's leadership, the bank <strong>weathered the storm of (D4)<\/strong> the Depression and subsequently moved into a phase of overseas development.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:03:22.000000Z","sequence_exam":[{"id_exam":206,"sequence":38},{"id_exam":207,"sequence":39},{"id_exam":208,"sequence":40}],"question":[{"id":206,"group_question_id":68,"list_question_id":19,"question":"<p><strong>(P1)<\/strong> Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers.<\/p><p><strong>(P2) <\/strong>One major test for Giannini's bank occurred on April. 18, 1906, when a massive earthquake struck San Francisco, followed by a raging fire that destroyed much of the city.<\/p><p><strong>(P3)<\/strong> Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p><strong>(P4)<\/strong> In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City.<\/p><p><br>Where in the passage does the author describe Giannini's first banking clients?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:07:11.000000Z"},{"id":207,"group_question_id":68,"list_question_id":19,"question":"How is the information in the passage presented?","option_1":"In chronological order","option_2":"In order of importance","option_3":"A cause followed by an effect","option_4":"Classifications with examples","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":208,"group_question_id":68,"list_question_id":19,"question":"The paragraph following the passage most likely discusses","option_1":"bank failures during the Great Depression","option_2":"a third major crisis of the Bank of America","option_3":"the international development of the Bank of America","option_4":"how Giannini spent his retirement","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":69,"list_question_id":19,"name":"R5A","description":"Questions 41-50","filename_group":"","question_group":"<p>Thunderstorms, with their jagged bursts of lightning and roaring thunder, are actually one of nature's primary <strong>mechanisms (E1) <\/strong>for transferring heat from the surface of the earth into the atmosphere. A thunderstorm starts when low-lying pockets of warm air from the surface of the earth begin to rise. The pockets of warm air float upward through the air above that is both cooler and heavier. The rising pockets cool as their pressure decreases, and their latent heat is released above the condensation line through the formation of cumulus clouds.<\/p><p>What will happen with these clouds depends on the temperature of the atmosphere. In winter, the air temperature differential between higher and lower altitudes is not extremely great, and the temperature of the rising air mass drops more slowly. During these colder months, the atmosphere, therefore, tends to remain rather stable. In summer, however, when there is a high accumulation of heat near the earth's surface, in direct contrast to the considerably colder air higher up, the temperature differential between higher and lower altitudes is much more pronounced. As warm air rises in this type of environment, the temperature drops much more rapidly than it does in winter; when the temperature drops more than four degrees Fahrenheit per thousand feet of altitude, cumulus clouds aggregate into a single massive cumulonimbus cloud or thunderhead.<\/p><p>In isolation, a single thunderstorm is an impressive but fairly <strong>benign (E2) <\/strong>way for Mother Earth to defuse trapped heat from her surface; thunderstorms, however, can appear <strong>in concert (E3)<\/strong>, and the resulting show, while extremely impressive, can also prove extraordinarily destructive. When there is a large-scale collision between cold air and warm air masses during the summer months, <strong>a squall line (E4)<\/strong>, or series of thunderheads, may develop. It is common for a squall line to begin when an advancing cold front meets up with and forces <strong>itself (E5) <\/strong>under a layer of warm and moist air, creating a line of thunderstorms that races forward at speeds of approximately forty miles per hour. A squall line, which can be hundreds of miles long and can contain fifty distinct thunderheads, is a magnificent force of nature with incredible potential for destruction. Within the squall line, often near its southern end, can be found supercells, long-lived rotating storms of exceptional strength that serve as the source of tornadoes.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:11:01.000000Z","sequence_exam":[{"id_exam":209,"sequence":41},{"id_exam":210,"sequence":42},{"id_exam":211,"sequence":43}],"question":[{"id":209,"group_question_id":69,"list_question_id":19,"question":"The topic of the passage is","option_1":"the development of thunderstorms and squall lines","option_2":"the devastating effects of tornadoes","option_3":"cumulus and cumulonimbus clouds","option_4":"the power of tornadoes","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"},{"id":210,"group_question_id":69,"list_question_id":19,"question":"<p>\"Mechanisms\" <strong>(E1)<\/strong> are most likely<\/p>","option_1":"machines","option_2":"motions","option_3":"methods","option_4":"materials","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:12:26.000000Z"},{"id":211,"group_question_id":69,"list_question_id":19,"question":"It can be inferred from the passage that, in summer,","option_1":"there is not a great temperature differential between higher and lower altitudes","option_2":"the greater temperature differential between higher and lower altitudes makes thunderstorms more likely to occur","option_3":"there is not much cold air higher up in the atmosphere","option_4":"the temperature of rising air drops more slowly than it does in winter","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z"}]},{"id":70,"list_question_id":19,"name":"R5B","description":"Questions 41-50","filename_group":"","question_group":"<p>Thunderstorms, with 