 and forces <strong>itself (E5) <\/strong>under a layer of warm and moist air, creating a line of thunderstorms that races forward at speeds of approximately forty miles per hour. A squall line, which can be hundreds of miles long and can contain fifty distinct thunderheads, is a magnificent force of nature with incredible potential for destruction. Within the squall line, often near its southern end, can be found supercells, long-lived rotating storms of exceptional strength that serve as the source of tornadoes.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:11:33.000000Z","sequence_exam":[{"id_exam":212,"sequence":44},{"id_exam":213,"sequence":45},{"id_exam":214,"sequence":46}],"question":[{"id":212,"group_question_id":70,"list_question_id":19,"question":"<p>The word \"benign\" <strong>(E2)<\/strong> is closest in meaning to<\/p>","option_1":"harmless","option_2":"beneficial","option_3":"ferocious","option_4":"spectacular","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:12:53.000000Z"},{"id":213,"group_question_id":70,"list_question_id":19,"question":"<p>The expression \"in concert\" <strong>(E3)<\/strong> could best be replaced by<\/p>","option_1":"as a chorus","option_2":"with other musicians","option_3":"as a cluster","option_4":"in a performance","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:13:25.000000Z"},{"id":214,"group_question_id":70,"list_question_id":19,"question":"<p>According to the passage, a \"squall line\" <strong>(E4)<\/strong> is<\/p>","option_1":"a lengthy cold front","option_2":"a serious thunderstorm","option_3":"a line of supercells","option_4":"a string of thunderheads","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:14:14.000000Z"}]},{"id":71,"list_question_id":19,"name":"R5C","description":"Questions 41-50","filename_group":"","question_group":"<p>Thunderstorms, with their jagged bursts 