INFO - 2022-02-25 01:24:32 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":61,"current_group":62,"next_group":63,"data_group":{"id":62,"list_question_id":19,"name":"R3A","description":"Questions 20-28","filename_group":"","question_group":"<p>There is a common expression in the English language referring to a blue moon. When people say that something happens \"only once in a blue moon: they mean that it happens only very rarely, once in a great while. This expression has been around for at least a century and a half; there are references to this expression that date from the second half of the nineteenth century.<\/p><p>The expression \"a blue moon\" has come to refer to the second full moon occurring in any given calendar month. A second full moon is not called a blue moon because it is particularly blue or is any different in <strong>hue (C1) <\/strong>from the first full moon of the month. Instead, it is called a blue moon because it is so rare. The moon needs a little more than 29 days to complete the cycle from full moon to full moon. Because every month except February has more than 29 days, every month will have at least one full moon (except February. which will have a full moon unless there is a full moon at the very end of January and another full moon at the very beginning of March). It is on the occasion when a given calendar month has a second full moon that a blue moon occurs. This does not happen very often, only three or four times in a decade.<\/p><p>The blue moons of today are called blue moons because of their rarity and not because of their color; however. The expression \"blue moon\" may have come into existence in reference to unusual circumstances in which the moon actually appeared blue. Certain natural phenomena of gigantic proportions can actually change the appearance of the moon from Earth. The eruption of the Krakatao volcano in 1883 left dust particles in the atmosphere, which clouded the sun and gave the moon a bluish tint. This particular occurrence of the blue moon may have <strong>given rise to (C2)<\/strong> the expression that we use today. Another example occurred more than a century later. When Mount Pinatub erupted in the Philippines in 1991, the moon again took on a blue tint.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:42:26.000000Z"},"exam_questions":[{"id":188,"group_question_id":62,"list_question_id":19,"question":"This passage is about","option_1":"an idiomatic expression","option_2":"an unusual color","option_3":"a month on the calendar","option_4":"a phase of the moon","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":189,"group_question_id":62,"list_question_id":19,"question":"How long has the expression \"once in a blue moon\" been around?","option_1":"For around 50 years","option_2":"For less than 100 years","option_3":"For more than 100 years","option_4":"For 200 years","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":190,"group_question_id":62,"list_question_id":19,"question":"A blue moon could best be described as","option_1":"a full moon that is not blue in color","option_2":"a new moon that is blue in color","option_3":"a full moon that is blue in color","option_4":"a new moon that is not blue in color","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]}]}}
