INFO - 2022-02-25 01:25:00 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":64,"current_group":65,"next_group":66,"data_group":{"id":65,"list_question_id":19,"name":"R4A","description":"Questions 29-40","filename_group":"","question_group":"<p>The organization that today is known as the Bank of America did start out in America, but under quite a different name. Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers. During its development, Giannini's bank survived major crises in the form of a natural disaster and a major economic upheaval that not all other banks were able to overcome.<\/p><p>One major test for Giannini's bank occurred on April 18, 1906, when a massive earthquake struck San Francisco, followed by a <strong>raging (D1) <\/strong>fire that destroyed much of the city. Giannini obtained two wagons and teams of horses, filled the wagons with the bank's reserves, mostly in the form of gold, covered the reserves with crates of oranges, and escaped from the <strong>chaos (D2) <\/strong>of the city with his clients' funds protected. In the aftermath of the disaster, Giannini's bank was the first to resume operations. Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p>In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City. In 1930 he <strong>consolidated (D3) <\/strong>all the branches of the Bank of Italy, the Bank of America in New York City, and another Bank of America that he had formed in California into the Bank of America National Trust and Savings Association.<\/p><p>A second major crisis for the bank occurred during the Great Depression of the 1930s. Although Giannini had already retired prior to the darkest days of the Depression, he became incensed when his successor began selling off banks during the bad economic times. Giannini resumed leadership of the bank at the age of sixty-two. Under Giannini's leadership, the bank <strong>weathered the storm of (D4)<\/strong> the Depression and subsequently moved into a phase of overseas development.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:54:44.000000Z"},"exam_questions":[{"id":197,"group_question_id":65,"list_question_id":19,"question":"29. According to the passage, Giannini","option_1":"opened the Bank of America in 1904","option_2":"worked in a bank in Italy","option_3":"set up the Bank of America prior to setting up the Bank of Italy","option_4":"later changed the name of the Bank of Italy","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":198,"group_question_id":65,"list_question_id":19,"question":"Where did Giannini open his first bank?","option_1":"In New York City","option_2":"In what used to be a bar","option_3":"On Washington Street Wharf","option_4":"On a makeshift desk","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":199,"group_question_id":65,"list_question_id":19,"question":"According to the passage, which of the following is NOT true about the San Francisco earthquake?","option_1":"It happened in 1906.","option_2":"It occurred in the aftermath of a fire.","option_3":"It caused problems for Giannini's bank.","option_4":"It was a tremendous earthquake.","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]}]}}
