INFO - 2022-02-25 01:25:10 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":65,"current_group":66,"next_group":67,"data_group":{"id":66,"list_question_id":19,"name":"R4B","description":"Questions 29-40","filename_group":"","question_group":"<p>The organization that today is known as the Bank of America did start out in America, but under quite a different name. Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers. During its development, Giannini's bank survived major crises in the form of a natural disaster and a major economic upheaval that not all other banks were able to overcome.<\/p><p>One major test for Giannini's bank occurred on April 18, 1906, when a massive earthquake struck San Francisco, followed by a <strong>raging (D1) <\/strong>fire that destroyed much of the city. Giannini obtained two wagons and teams of horses, filled the wagons with the bank's reserves, mostly in the form of gold, covered the reserves with crates of oranges, and escaped from the <strong>chaos (D2) <\/strong>of the city with his clients' funds protected. In the aftermath of the disaster, Giannini's bank was the first to resume operations. Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p>In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City. In 1930 he <strong>consolidated (D3) <\/strong>all the branches of the Bank of Italy, the Bank of America in New York City, and another Bank of America that he had formed in California into the Bank of America National Trust and Savings Association.<\/p><p>A second major crisis for the bank occurred during the Great Depression of the 1930s. Although Giannini had already retired prior to the darkest days of the Depression, he became incensed when his successor began selling off banks during the bad economic times. Giannini resumed leadership of the bank at the age of sixty-two. Under Giannini's leadership, the bank <strong>weathered the storm of (D4)<\/strong> the Depression and subsequently moved into a phase of overseas development.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:55:12.000000Z"},"exam_questions":[{"id":200,"group_question_id":66,"list_question_id":19,"question":"<p>The word \"raging\" <strong>(D1)<\/strong> could best be replaced by<\/p>","option_1":"angered","option_2":"localized","option_3":"intense","option_4":"feeble","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:01:01.000000Z","exam_result":[]},{"id":201,"group_question_id":66,"list_question_id":19,"question":"It can be inferred from the passage that Giannini used crates of oranges after the earthquake","option_1":"to hide the gold","option_2":"to fill up the wagons","option_3":"to provide nourishment for his customers","option_4":"to protect the gold from the fire","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":202,"group_question_id":66,"list_question_id":19,"question":"<p>The word \"chaos\" <strong>(D2)<\/strong> is closest in meaning to<\/p>","option_1":"legal system","option_2":"extreme heat","option_3":"overdevelopment","option_4":"total confusion","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:01:48.000000Z","exam_result":[]}]}}
