ormed in California into the Bank of America National Trust and Savings Association.<\/p><p>A second major crisis for the bank occurred during the Great Depression of the 1930s. Although Giannini had already retired prior to the darkest days of the Depression, he became incensed when his successor began selling off banks during the bad economic times. Giannini resumed leadership of the bank at the age of sixty-two. Under Giannini's leadership, the bank <strong>weathered the storm of (D4)<\/strong> the Depression and subsequently moved into a phase of overseas development.<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T15:03:22.000000Z"},"exam_questions":[{"id":206,"group_question_id":68,"list_question_id":19,"question":"<p><strong>(P1)<\/strong> Italian American A.P. Giannini established this bank on October 17, 1904, in a renovated saloon in San Francisco's Italian community of North Beach under the name Bank of Italy, with immigrants and first-time bank customers comprising the majority of his first customers.<\/p><p><strong>(P2) <\/strong>One major test for Giannini's bank occurred on April. 18, 1906, when a massive earthquake struck San Francisco, followed by a raging fire that destroyed much of the city.<\/p><p><strong>(P3)<\/strong> Unable to install the bank in a proper office setting, Giannini opened up shop on the Washington Street Wharf on a makeshift desk created from boards and barrels.<\/p><p><strong>(P4)<\/strong> In the period following the 1906 fire, the Bank of Italy continued to prosper and expand. By 1918 there were twenty-four branches of the Bank of Italy, and by 1928 Giannini had acquired numerous other banks, including a Bank of America located in New York City.<\/p><p><br>Where in the passage does the author describe Giannini's first banking clients?<\/p>","option_1":"P1","option_2":"P2","option_3":"P3","option_4":"P4","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-24T00:07:11.000000Z","exam_result":[]},{"id":207,"group_question_id":68,"list_question_id":19,"question":"How is the information in the passage presented?","option_1":"In chronological order","option_2":"In order of importance","option_3":"A cause followed by an effect","option_4":"Classifications with examples","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":208,"group_question_id":68,"list_question_id":19,"question":"The paragraph following the passage most likely discusses","option_1":"bank failures during the Great Depression","option_2":"a third major crisis of the Bank of America","option_3":"the international development of the Bank of America","option_4":"how Giannini spent his retirement","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]}]}}
