INFO - 2022-02-25 15:12:29 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"category_id":22,"previous_section":1,"current_section":1,"next_section":2,"questions":{"id":14,"question_category_id":22,"title_question":"LM01 A","is_publish":1,"section_id":1,"description":"<p><strong>SECTION 1<\/strong><br><strong>LISTENING COMPREHENSION<\/strong><br><strong>(Question 1-50)<\/strong><\/p><p><strong>Part A<\/strong><br><strong>Short Conversations<\/strong><\/p><p>Directions: In Part A, you will hear short conversations between 2 people. After each conversation, you will hear a question about the conversation. The conversations and questions will not be repeated.<\/p><p>After you hear a question, read the 4 possible answers on the screen and select the best answer by clicking on it.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p>(man) &nbsp;That exam was just awful.<br>(woman) &nbsp;Oh, it could've been worse.<br>(narrator) &nbsp;What does the woman mean?<\/p><p><br><strong>In your test book, you read:<\/strong><\/p><p>(A) The exam was really awful.<br>(B) It was the worst exam she had ever seen.<br>(C) It couldn't have been more difficult.<br>(D) It wasn't that hard.<\/p><p>You learn from the conversation that the man thought the exam was very difficult and that the woman disagreed with the man. The best answer to the question, \"What does the woman mean?\" is (D), \"It wasn't that hard.\" Therefore, the <strong>correct choice is (D)<\/strong><br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23T07:33:49.000000Z","updated_at":"2022-02-24T00:37:36.000000Z"},"last_session":{"id":33,"register_number":"2202261645801918","token":"9649396656218efac558da","session_key":"d23yuf","start_at":null,"finish_at":null,"created_at":"2022-02-25T15:03:08.000000Z","updated_at":"2022-02-25T15:12:03.000000Z"},"first_group":{"id":43,"list_question_id":14,"name":"LG01","description":"Question 1-5","filename_group":"LG01.mp3","question_group":"","created_at":"2022-02-22T22:34:38.000000Z","updated_at":"2022-02-22T22:37:31.000000Z"}}}
