INFO - 2022-02-25 19:35:42 --> get {"response":{"code":200,"message":"Success retrieve list questions"},"data":{"category_id":22,"previous_section":2,"current_section":3,"next_section":3,"questions":{"id":16,"question_category_id":22,"title_question":"LM01 C","is_publish":1,"section_id":3,"description":"<p><strong>Part C<\/strong><br><strong>Long Talks<\/strong><\/p><p><strong>Directions<\/strong>: In this part of the test, you will hear several talks. After each talk, you will hear some questions. The talks and questions will not be repeated.<\/p><p>After you hear a question, read the four possible answers in your test book and choose the best answer. Then, on your answer sheet, find the number of the question and fill in the space that corresponds to the letter of the answer you have chosen.<\/p><p>Here is an example.<\/p><p><strong>On the recording, you hear:<\/strong><\/p><p><strong>(narrator)&nbsp;<\/strong> Listen to an instructor talk to his class about painting.<\/p><p><br><strong>(man)&nbsp;<\/strong> Artist Grant Wood was a guiding force in the school of painting known as American regionalist, a style reflecting the distinctive characteristics of art from rural areas of the United States. Wood began drawing animals on the family farm at the age of three, and when he was thirty-eight, one of his paintings received a remarkable amount of public notice and acclaim. This painting, called American Gothic, is a starkly simple depiction of a serious couple starting directly out at the viewer<\/p><p><strong>Now listen to a sample question.<\/strong><\/p><p>(narrator) What style of painting is known as American regionalist?<\/p><p><strong>In your test book, you read:<\/strong><br><br>(A) Art from America's inner cities<br>(B) Art from the central region of the United States<br>(C) Art from various urban areas in the United States<br>(D) Art from rural sections of America<\/p><p>The best answer to the question \"What style of painting is known as American regionalist?\" is (D), \"Art from rural sections of America.\" Therefore, the correct choice is (D).<\/p><p>Now listen to another sample question.<\/p><p>(narrator) What is the name of Wood's most successful painting?<\/p><p>In your test book, you read:<\/p><p>&nbsp;<br>(A) American Regionalist<br>(B) The Family Farm in Iowa<br>(C) American Gothic<br>(D) A Serious Couple<\/p><p>The best answer to the question, \"What is the name of Wood's most successful painting?\" is (C), American Gothic. Therefore, the correct choice is (C).<\/p><p>Remember, you are not allowed to take notes or write in your test book.<br>&nbsp;<\/p>","created_by":1,"updated_by":1,"created_at":"2022-02-23T08:00:18.000000Z","updated_at":"2022-02-23T12:53:50.000000Z"},"last_session":{"id":34,"register_number":"2202261645816879","token":"160946549362192bdec9dd4","session_key":"d23yuf","start_at":"2022-02-26 04:21:26","finish_at":null,"created_at":"2022-02-25T19:19:58.000000Z","updated_at":"2022-02-25T19:21:26.000000Z"},"first_group":{"id":51,"list_question_id":16,"name":"LG09","description":"Question 39-42","filename_group":"LG09.mp3","question_group":"<p><br><\/p><p><br><\/p><p><br><\/p><p>Jancooooookkkkkkkkkkkkkk<br><\/p>","created_at":"2022-02-22T23:00:49.000000Z","updated_at":"2022-02-23T00:02:27.000000Z"}}}
