INFO - 2022-02-25 20:03:23 --> get {"response":{"code":200,"message":"Success retrieve data"},"data":{"previous_group":58,"current_group":59,"next_group":60,"data_group":{"id":59,"list_question_id":19,"name":"R2A","description":"Question 10-19","filename_group":"","question_group":"<p>These stories of killer bees in the news in recent years have attracted a lot of attention as the bees have made their way from South America to North America. Killer bees are reputed to be extremely aggressive in nature, although experts say that their aggression may have been somewhat <strong>inflated (B1)<\/strong>.<\/p><p><br>The killer bee is a <strong>hybrid (B2) <\/strong>\u2013 or combination \u2013 of the very mild European strain of honeybee and the considerably more aggressive African bee, which was created when the African strain was imported into Brazil in 1955. The African bees were brought into Brazil because their aggression was considered an advantage: they were far more productive than their European counterparts in that they spent a higher percentage of their time working and continued working longer in inclement weather than did the European bees.<\/p><p><br>These killer bees have been known to attack humans and animals, and some fatalities have occurred. Experts point out, however, that the mixed breed known as the killer bee is actually not at all as aggressive as the pure African bee. <strong>They (B3) <\/strong>also point out that the attacks have a chemical cause. A killer bee stings only when it has been disturbed; it is not aggressive by nature'. However, after a disturbed bee stings and flies away, it leaves its stinger embedded in the victim. In the vicera attached to the embedded stinger is the chemical isoamyl acetate, which has an odor that attracts other bees. As other bees approach the victim of the original sting, the victim tends to panic, thus disturbing other bees and causing them to sting. The new stings create more of the chemical isoamyl acetate, which attracts more bees and increases the panic level of the victim. Killer bees tend to travel in large clusters or swarms and thus respond in large numbers to the production of isoamyl acetate<br>&nbsp;<\/p>","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T14:10:24.000000Z"},"exam_questions":[{"id":178,"group_question_id":59,"list_question_id":19,"question":"The subject of the preceding paragraph was most likely","option_1":"ways of producing honey","option_2":"stories in the media about killer bees","option_3":"the chemical nature of killer bee attacks","option_4":"the creation of the killer bee","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":179,"group_question_id":59,"list_question_id":19,"question":"The main idea of this passage is that killer bees","option_1":"have been in the news a lot recently","option_2":"have been moving unexpectedly rapidly through the Americas","option_3":"are not as aggressive as their reputation suggests","option_4":"are a hybrid rather than a pure breed","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T13:26:16.000000Z","exam_result":[]},{"id":180,"group_question_id":59,"list_question_id":19,"question":"<p>The word \"inflated\" <strong>(B1)<\/strong> could best be replaced by<\/p>","option_1":"exaggerated","option_2":"blown","option_3":"aired","option_4":"burst","option_5":"","created_at":"2022-02-23T13:26:16.000000Z","updated_at":"2022-02-23T23:02:48.000000Z","exam_result":[]}],"is_last_category":true}}
